import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the third video item to load
    await page.waitForSelector('.video-item:nth-child(3) .channel-name');

    // Extract the channel name from the third video item
    const channelName = await page.textContent('.video-item:nth-child(3) .channel-name');

    // Log the extracted channel name
    console.log('Extracted Channel Name:', channelName);

    // Take a screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_channel_name_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_channel_name_extracted.png'));

    return {
      success: true,
      action: "Extracted the channel name from the third video item",
      extractedData: { channelName },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

